import {Card, Image} from "react-bootstrap";
import CardBack from "./back.png"

const Back = (props) => {

    return(
        <div className = "">        
        <Card>
        <Image src = {CardBack}fluid> 
        </Image> 
        </Card></div>

    )
}

export default Back;
